import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';
import axios from 'axios';

function DetailScreening() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [screening, setScreening] = useState(null);

  const pertanyaanList = [
    'Batuk Lebih Dari 2 Minggu',
    'Demam',
    'Berkeringat Malam Hari Tanpa Aktivitas',
    'Sesak Nafas',
    'Nyeri Dada',
    'Ada benjolan di leher/bawah rahang/bawah telinga/ketiak',
    'Batuk berdarah',
    'Batuk kurang dari 2 minggu',
    'Nafsu makan turun',
    'Mudah lelah',
    'Berat badan turun',
    'Anggota keluarga serumah ada yang sakit TBC',
    'Pernah berada satu ruangan dengan penderita TBC',
    'Tinggal serumah dengan penderita TBC minimal satu malam/sering siang hari',
    'Pernah Berobat TBC tuntas',
    'Pernah berobat TBC tapi tidak tuntas',
    'Punya riwayat diabetes melitus/kencing manis',
    'Orang dengan HIV',
    'Ibu Hamil',
    'Merokok',
    'Usia 0-14 Tahun',
    'Lansia (Diatas 60 Tahun)',
  ];

  useEffect(() => {
    const fetchData = async () => {
      const userId = sessionStorage.getItem('user_id');
      const role = sessionStorage.getItem('role');
      try {
        const res = await axios.get('http://localhost:5000/riwayat-screening', {
          params: { user_id: userId, role }
        });
        const data = res.data.find(item => item.id === parseInt(id));
        if (data) {
          // parse jawaban jika masih string
          if (typeof data.jawaban === 'string') {
            try {
              data.jawaban = JSON.parse(data.jawaban);
            } catch (e) {
              console.error("❌ Gagal parsing jawaban:", e);
              data.jawaban = Array(22).fill(null);
            }
          }
          setScreening(data);
        } else {
          alert("Data tidak ditemukan");
          navigate('/riwayat');
        }
      } catch (err) {
        console.error(err);
      }
    };

    fetchData();
  }, [id, navigate]);

  return (
    <>
      <Header />
      <div className="container mt-5 mb-5">
        <div className="card shadow rounded-4 p-4">
          <h4 className="mb-4">📝 Detail Screening</h4>
          {screening && (
            <>
              <p>👤 <strong>Nama:</strong> {screening.nama}</p>
              <p>📅 <strong>Tanggal:</strong> {screening.tanggal_screening}</p>
              <p>📈 <strong>Probabilitas:</strong> {(screening.probabilitas * 100).toFixed(2)}%</p>
              <p>⚠️ <strong>Hasil:</strong> <span className={`badge ${screening.hasil === 'Positif' ? 'bg-danger' : 'bg-success'}`}>{screening.hasil}</span></p>
              
              <hr />
              <h5 className="mt-4">🗒️ Jawaban:</h5>
              <ul className="list-group mt-2">
                {pertanyaanList.map((pertanyaan, index) => {
                  const jawaban = screening.jawaban?.[index];
                  let label = "Tidak tersedia";
                  let className = "text-muted";

                  if (jawaban === 1 || jawaban === '1') {
                    label = "Ya";
                    className = "text-success fw-semibold";
                  } else if (jawaban === 0 || jawaban === '0') {
                    label = "Tidak";
                    className = "text-danger fw-semibold";
                  }

                  return (
                    <li key={index} className="list-group-item d-flex justify-content-between align-items-center">
                      {index + 1}. {pertanyaan}
                      <span className={className}>{label}</span>
                    </li>
                  );
                })}
              </ul>
            </>
          )}
        </div>
      </div>
      <Footer />
    </>
  );
}

export default DetailScreening;
